import React from 'react'
import {Col,Row} from 'react'
import products from '../products'
const HomeScreen = () => {
  return (
    <>
    <h>Latest products</h>
    <Row>
     
       {
        products.map(product=>
        {
           <Col sm={12} md={6} lg={4}>
            <h>{product.name}</h>
           </Col>
        })
       } 
     
    </Row>
    </>
    
  )
}

export default HomeScreen
